import React from "react";
import ReactDOM from "react-dom/client";
import { RouterProvider } from "react-router-dom";

import App, { router } from "./App";

ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <RouterProvider>
      router={router}
      <App />
    </RouterProvider>
  </React.StrictMode>
);
